import { Layout, Breadcrumb } from 'antd';

const { Content } = Layout;

List.getInitialProps = async function () {
    const res = await fetch('https://worker-api.wanshifu.com/master/listinfo');
    const data = await res.json();
    return {
        shows: data
    }
}

const List = (props) => {
    return (
        <ul>
            {
                props.shows.data.list.map((ele)=>{
                    return (
                        <li>{ele.ironDir}</li>
                    )
                })
            }
        </ul>
    )
}

export default List
